import React, {Component} from 'react';
import EditExpense from '../edit-expense/edit-expense';



class ExpenseCondensed extends Component {
    
     constructor(props){
        super(props);
        this.editExpense = this.editExpense.bind(this);
        this.onButtonClicked = this.onButtonClicked.bind(this);           
    }

    editExpense = () => {
        <EditExpense expense={this.props.expense}/>
    }

    onButtonClicked = () =>{
       this.editExpense();         
    }
    
    
    render(){
        return(
            <li className="list-group-item expense-condensed">                        
            <p className="text-dark">{this.props.expense.title} | ${this.props.expense.cost}</p>
            <p className="text-dark">{this.props.expense.people}</p>
            <button className="btn btn-outline-danger text-dark" onClick={() => this.onButtonClicked()}>Edit</button>
        </li>     
        )
    }
}

export default ExpenseCondensed;
